import './App.css';
import React, { useEffect, useState } from 'react';
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
const {Account} = require('@tago-io/sdk'); 

let render = 0;
function App() {
   const account = new Account({token:"a394b4c9-7ea7-4346-bbe1-ddb35f9bc948"});
    console.log("teste3")
    const [arrayOfdevices,setArray] = useState([]);

    const notify = () => toast.success("Configuration performed!");
    const toastAlert = () => toast.error("Configuration already exists!");
    const AlertError = () => toast.error("There are more than 1 comands in the queue, it's not possible to add more commands.");
    const error = () => toast.error("There is a command in the file, it's not possible to add more commands before of execute that is in the file.")


    async function listdevices(){
        console.log('ativou')
        let listResponse =  await account.devices.list();

        render++;
           render === 1 ? setArray(listResponse)
                                     : console.log()
       } 



        useEffect( () => {
            listdevices()
        } )



        window.TagoIO.onStart((widget) => {
            window.widget = widget;
        })
        window.TagoIO.ready();
        console.log('teste')



        function subscribe(idDevice,idParam,code){
            account.devices.paramSet(idDevice,{key:"CMD", value:code,sent:false},idParam);
            notify();
        }




       let funcs = [];
       funcs['Carga último perfil da plataforma'] = (idDevice) => { 
           account.devices.paramList(idDevice).then((resp) => {


              let config = resp.filter((param) => {return param.key === "CMD"});

              if(config.length >= 2){
                AlertError();
              }else{
                if(resp[0] !== undefined){
                    resp[0].sent === true 
                            ? subscribe(idDevice,resp[0].id,"0*")
                                            : error();   
                   }else{
                       account.devices.paramSet(idDevice, {key:"CMD", value: '0*', sent: false}).catch((err) => { console.log(err) });
                       notify()
                    }
               }

            });
        }; 



        funcs['Solicitar Identificação ID'] = (idDevice) => { 
            account.devices.paramList(idDevice).then((resp) => {


               let config = resp.filter((param) => {return param.key === "CMD"});

               if(config.length >= 2){
                 AlertError();
               }else{
                 if(resp[0] !== undefined){
                     resp[0].sent === true 
                             ? subscribe(idDevice,resp[0].id,"1*")
                                             : error();   
                    }else{
                        account.devices.paramSet(idDevice, {key:"CMD", value: '1*', sent: false}).catch((err) => { console.log(err) });
                        notify()
                     }
                }

             });
         };



         funcs['Reiniciar Dispositivo'] = (idDevice) => { 
            account.devices.paramList(idDevice).then((resp) => {


               let config = resp.filter((param) => {return param.key === "CMD"});

               if(config.length >= 2){
                 AlertError();
               }else{
                 if(resp[0] !== undefined){
                     resp[0].sent === true 
                             ? subscribe(idDevice,resp[0].id,"2*")
                                             : error();   
                    }else{
                        account.devices.paramSet(idDevice, {key:"CMD", value: '2*', sent: false}).catch((err) => { console.log(err) });
                        notify()
                     }
                }

             });
         };  



         funcs['Ligar Modo Emergência'] = (idDevice) => { 
            account.devices.paramList(idDevice).then((resp) => {


               let config = resp.filter((param) => {return param.key === "CMD"});

               if(config.length >= 2){
                 AlertError();
               }else{
                 if(resp[0] !== undefined){
                     resp[0].sent === true 
                             ? subscribe(idDevice,resp[0].id,"3*")
                                             : error();   
                    }else{
                        account.devices.paramSet(idDevice, {key:"CMD", value: '3*', sent: false}).catch((err) => { console.log(err) });
                        notify()
                     }
                }

             });
         };



         funcs['Ligar Modo Normal'] = (idDevice) => { 
            account.devices.paramList(idDevice).then((resp) => {


               let config = resp.filter((param) => {return param.key === "CMD"});

               if(config.length >= 2){
                 AlertError();
               }else{
                 if(resp[0] !== undefined){
                     resp[0].sent === true 
                             ? subscribe(idDevice,resp[0].id,"3#")
                                             : error();   
                    }else{
                       account.devices.paramSet(idDevice, {key:"CMD", value: '3#', sent: false}).catch((err) => { console.log(err) });
                      notify()
                     }
                }

             });
         };



         funcs['Solicita Posição LBS / GPS'] = (idDevice) => { 
            account.devices.paramList(idDevice).then((resp) => {


               let config = resp.filter((param) => {return param.key === "CMD"});

               if(config.length >= 2){
                 AlertError();
               }else{
                 if(resp[0] !== undefined){
                     resp[0].sent === true 
                             ? subscribe(idDevice,resp[0].id,"4*")
                                             : error();   
                    }else{
                       account.devices.paramSet(idDevice, {key:"CMD", value: '4*', sent: false}).catch((err) => { console.log(err) });
                      notify()
                     }
                }

             });
         };



         funcs['Status da Bateria'] = (idDevice) => { 
            account.devices.paramList(idDevice).then((resp) => {


               let config = resp.filter((param) => {return param.key === "CMD"});

               if(config.length >= 2){
                 AlertError();
               }else{
                 if(resp[0] !== undefined){
                     resp[0].sent === true 
                             ? subscribe(idDevice,resp[0].id,"5*")
                                             : error();   
                    }else{
                       account.devices.paramSet(idDevice, {key:"CMD", value: '5*', sent: false}).catch((err) => { console.log(err) });
                      notify()
                     }
                }

             });
         };



         funcs['Alterar Frequência RF433'] = (idDevice) => { 
            account.devices.paramList(idDevice).then((resp) => {


               let config = resp.filter((param) => {return param.key === "CMD"});

               if(config.length >= 2){
                 AlertError();
               }else{
                 if(resp[0] !== undefined){
                     resp[0].sent === true 
                             ? subscribe(idDevice,resp[0].id,"6*")
                                             : error();   
                    }else{
                       account.devices.paramSet(idDevice, {key:"CMD", value: '6*', sent: false}).catch((err) => { console.log(err) });
                      notify()
                     }
                }

             });
         };



         funcs['Alterar Melodia RF433'] = (idDevice) => { 
            account.devices.paramList(idDevice).then((resp) => {


               let config = resp.filter((param) => {return param.key === "CMD"});

               if(config.length >= 2){
                 AlertError();
               }else{
                 if(resp[0] !== undefined){
                     resp[0].sent === true 
                             ? subscribe(idDevice,resp[0].id,"7*")
                                             : error();   
                    }else{
                       account.devices.paramSet(idDevice, {key:"CMD", value: '7*', sent: false}).catch((err) => { console.log(err) });
                      notify()
                     }
                }

             });
         };


        function insertParam(){
            let selectConfig = document.getElementById("configs");
            let name = selectConfig.options[selectConfig.selectedIndex].value;

            let selectDevice = document.getElementById("devices");
            let id = selectDevice.options[selectDevice.selectedIndex].value;


            funcs[name](id)
        }

        console.log('jsx') 
        return(
             <div className="container">
                <ToastContainer />
                    <div className="box">

                        <div className ="cabecalho">
                            <div className ="title">Enviar Comando</div>
                        </div>


                        <div className ="fieldOfSelection">

                            <div className=" label_dev">
                                <img className ="drop" alt='' src="https://img.icons8.com/external-zen-filled-royyan-wijaya/2x/external-list-dropdown-business-zen-filled-royyan-wijaya.png" />
                                <div className ="title_label">Selecione os Dispositivos</div> 
                            </div>


                             <div className="input">
                                    <select id="devices" className ="devices">
                                    {arrayOfdevices.map((item) =>{
                                            return(
                                                <option value={item.id}>{item.name}</option>
                                            )
                                    })}
                                    </select>
                                </div> 




                            <div className ="secondInput">

                                <div className =" label_dev">
                                    <img alt='' className ="drop" src="https://img.icons8.com/windows/2x/expand-arrow.png"/>
                                    <div className ="title_label">CMD</div> 
                                </div>


                                <select id="configs" className ="inputCmd">
                                    <option value="Carga último perfil da plataforma">Carga último perfil da plataforma</option>
                                    <option value="Solicitar Identificação ID">Solicitar Identificação ID</option>
                                    <option value="Reiniciar Dispositivo">Reiniciar dispositivo</option>
                                    <option value="Ligar Modo Emergência">Ligar Modo Emergência</option>
                                    <option value="Ligar Modo Normal">Ligar Modo Normal</option>
                                    <option value="Solicita Posição LBS / GPS">Solicita Posição LBS / GPS</option>
                                    <option value="Status da Bateria">Status da Bateria</option>
                                    <option value="Alterar Frequência RF433">Alterar Frequência RF433</option>
